import React, { useState, useEffect } from 'react';
import axios from '../axios';
import { useNavigate, Link } from 'react-router-dom';

const Products = () => {
    const [products, setProducts] = useState([]);
    const [name, setName] = useState('');
    const [description, setDescription] = useState('');
    const [price, setPrice] = useState('');
    const [unit, setUnit] = useState(''); // State for the unit of the product
    const [message, setMessage] = useState('');
    const navigate = useNavigate();

    // Function to fetch products from the API
    const fetchProducts = async () => {
        try {
            const storeId = localStorage.getItem('store_id');
            if (!storeId) {
                setMessage('No store selected');
                return;
            }
            const response = await axios.get(`/api/products?store_id=${storeId}`);
            setProducts(response.data);
        } catch (error) {
            setMessage('Failed to fetch products');
        }
    };

    // Fetch products when the component mounts
    useEffect(() => {
        fetchProducts();
    }, []);

    // Function to handle adding a new product
    const handleAddProduct = async (e) => {
        e.preventDefault();
        try {
            const storeId = localStorage.getItem('store_id');
            if (!storeId) {
                setMessage('No store selected');
                return;
            }
            const formattedPrice = parseFloat(price).toFixed(2); // Ensure the price is formatted to two decimal places
            const response = await axios.post('/api/products', { name, description, price: formattedPrice, unit, store_id: storeId });
            setMessage(response.data.message);
            // Clear input fields after successful product addition
            setName('');
            setDescription('');
            setPrice('');
            setUnit('');
            fetchProducts(); // Refresh the products list
        } catch (error) {
            setMessage('Failed to add product: ' + (error.response?.data.message || error.message));
        }
    };

    return (
        <div>
            <h2>Products</h2>
            {/* Form to add a new product */}
            <form onSubmit={handleAddProduct}>
                <div>
                    <label htmlFor="name">Name:</label>
                    <input type="text" id="name" value={name} onChange={(e) => setName(e.target.value)} required />
                </div>
                <div>
                    <label htmlFor="description">Description:</label>
                    <input type="text" id="description" value={description} onChange={(e) => setDescription(e.target.value)} required />
                </div>
                <div>
                    <label htmlFor="price">Price:</label>
                    <input type="number" id="price" value={price} onChange={(e) => setPrice(e.target.value)} required />
                </div>
                <div>
                    <label htmlFor="unit">Unit:</label>
                    <input type="text" id="unit" value={unit} onChange={(e) => setUnit(e.target.value)} required />
                </div>
                <button type="submit">Add Product</button>
            </form>
            <p>{message}</p>
            <h3>Product List</h3>
            {/* Display the list of products */}
            <ul>
                {products.map((product) => (
                    <li key={product.id}>
                        {product.name} - {product.description} - ${parseFloat(product.price).toFixed(2)} - {product.unit}
                        <button>Edit</button>
                        <button>Delete</button>
                    </li>
                ))}
            </ul>
            {/* Link to navigate to the storefront */}
            <Link to={`/storefront/${localStorage.getItem('store_id')}`}>Go to Storefront</Link>
        </div>
    );
};

export default Products;
